import React from 'react';
import JobSearch from '../component/cari/jobSearch';
import Navbar from '../component/navbar/navbar';
import Homepage from './homepage';

const Index = () => {
    return (
        <div>
            <Navbar/>
            <JobSearch/>
            <Homepage/>
            
        </div>
    );
}

export default Index;
